import axios from 'axios';
import React, { useEffect, useState } from 'react'
import DatePicker from "react-datepicker";
import "react-datepicker/dist/react-datepicker.css";
import bannerbg from '../Assets/images/banner-bg.png'
import bannercar from '../Assets/images/banner-car-img.png'
const SearchCarBox = () => {
    const [fromDate, setFromDate] = useState(new Date());
    const [toDate, setToDate] = useState(null);
    const [fromTime, setFromTime] = useState();
    const [toTime, settoTime] = useState();
    const [city, setcity] = useState();
    const { REACT_APP_SERVER_URL } = process.env;
    useEffect(() => {
      fetchCity()
    
    }, [])
    const fetchCity=async()=>{
        await axios({
            url:`${REACT_APP_SERVER_URL}/Hexrental/api/web-city/list`,
            method:'GET',

        }).then((res)=>{
            console.log(res.data,'city');
        })
    }
  const handleFromDateChange = (date) => {
    console.log(date,'date');
    setFromDate(date);
    setToDate(null); // reset to date when from date changes
  };
  let Day1 = String(fromDate.getDate()).padStart(2, '0');
  let Month1 = String(fromDate.getMonth() + 1).padStart(2, '0');
  let Year1 = new Date(fromDate).getFullYear();
  let dayone = `${Year1}-${Month1}-${Day1}`;
  console.log(dayone);

  const handleToDateChange = (date) => {
    setToDate(date);
    console.log(date);
  };
  let Day2 = String(fromDate.getDate()).padStart(2, '0');
  let Month2 = String(fromDate.getMonth() + 1).padStart(2, '0');
  let Year2 = new Date(fromDate).getFullYear();
  let daytwo = `${Year2}-${Month2}-${Day2}`;
  console.log(daytwo);

  const handleToTime=(event)=>{
    settoTime((event.target.value))
    console.log(event.target.value);
  }
  const handleFromTime=(event)=>{
    setFromTime((event.target.value))
    console.log(event.target.value);
  }

const searchCar=async()=>{
    await axios({
        url:`${REACT_APP_SERVER_URL}/api/item/search-web?from_date=${dayone} ${fromTime}&to_date=${daytwo} ${toTime}&city_id=1&city_loc_id=2&cur_type=1&vehicle_type=0&brand_type=0`,
        method:"GET"
    }).then((response)=>{
        console.log(response.data,'success');
        // setlist(response.data.Models)
    }).catch((error)=>{
        console.log(error);
    })
}
  return (
    
        <div className="col-lg-4 car-banner-img">
            <div className="banner-registration">
                <div className="banner-registration-registration">
                    <h6 className="banner-register-name">Search your ride</h6>
                </div>
                    <div className="form-group">
                        <label for="exampleFormControlSelect1" className="banner-form-label">SELECT CITY</label>
                        <select className="form-control" id="exampleFormControlSelect1">
                          <option>1</option>
                        </select>
                      </div>
                      <div className="form-group">
                        <label for="exampleFormControlSelect1" className="banner-form-label">SELECT LOCATION</label>
                        <select className="form-control" id="exampleFormControlSelect1" >
                          <option>1</option>
                        </select>
                      </div>
                      
    
        <div className="row">
            <div className="form-group col-md-6 col-6 date-col">
                <label for="exampleFormControlSelect1" className="banner-form-label">RETURN DATE</label>
                
                 <DatePicker
                        id="from-date"
                        selected={fromDate}
                        onChange={handleFromDateChange}
                        minDate={new Date()}
                        startDate={fromDate}
                        selectsStart
                        className="form-control"
                        dateFormat="yyyy/MM/dd"
                />

            </div>
           
            <div className="form-group col-md-6 col-6 time-col">
                <label for="exampleFormControlSelect1" className="banner-form-label">RETURN TIME</label>
                <select name="ddlpickTime" id="ddlpickTime" className="time-box form-control" value={fromTime} onChange={handleFromTime} >
                    <option value="00:00">00:00</option>
                    <option value="00:30">00:30</option>
                    <option value="01:00">01:00</option>
                    <option value="01:30">01:30</option>
                    <option value="02:00">02:00</option>
                    <option value="02:30">02:30</option>
                    <option value="03:00">03:00</option>
                    <option value="03:30">03:30</option>
                    <option value="04:00">04:00</option>
                    <option value="04:30">04:30</option>
                    <option value="05:00">05:00</option>
                    <option value="05:30">05:30</option>
                    <option value="06:00">06:00</option>
                    <option value="06:30">06:30</option>
                    <option value="07:00">07:00</option>
                    <option value="07:30">07:30</option>
                    <option value="08:00">08:00</option>
                    <option value="08:30">08:30</option>
                    <option value="09:00">09:00</option>
                    <option value="09:30">09:30</option>
                    <option value="10:00">10:00</option>
                    <option value="10:30">10:30</option>
                    <option value="11:00">11:00</option>
                    <option value="11:30">11:30</option>
                    <option value="12:00">12:00</option>
                    <option value="12:30">12:30</option>
                    <option value="13:00">13:00</option>
                    <option value="13:30">13:30</option>
                    <option value="14:00">14:00</option>
                    <option value="14:30">14:30</option>
                    <option value="15:00">15:00</option>
                    <option value="15:30">15:30</option>
                    <option value="16:00">16:00</option>
                    <option value="16:30">16:30</option>
                    <option value="17:00">17:00</option>
                    <option value="17:30">17:30</option>
                    <option value="18:00">18:00</option>
                    <option value="18:30">18:30</option>
                    <option value="19:00">19:00</option>
                    <option value="19:30">19:30</option>
                    <option value="20:00">20:00</option>
                    <option value="20:30">20:30</option>
                    <option value="21:00">21:00</option>
                    <option value="21:30">21:30</option>
                    <option value="22:00">22:00</option>
                    <option value="22:30">22:30</option>
                    <option value="23:00">23:00</option>
                    <option value="23:30">23:30</option>
                  </select>
            
            </div>
          </div>
       
         
         <div className="row">
            <div className="form-group col-md-6 col-6 date-col">
                <label for="exampleFormControlSelect1" className="banner-form-label">RETURN DATE</label>
                {/* <input name="txtdate" type="date" id="txtdate" className="form-control"/> */}
                <DatePicker
        id="to-date"
        selected={toDate}
        onChange={handleToDateChange}
        minDate={fromDate}
        startDate={fromDate}
        className="form-control"
        selectsEnd
        dateFormat="yyyy/MM/dd"
        disabled={!fromDate} // disable until from date is selected
      />
                
            </div>
            <div className="form-group col-md-6 col-6 time-col">
                <label for="exampleFormControlSelect1" className="banner-form-label">RETURN TIME</label>
                <select name="ddlpickTime" id="ddlpickTime" className="time-box form-control" value={toTime} onChange={handleToTime} >
                    <option value="00:00">00:00</option>
                    <option value="00:30">00:30</option>
                    <option value="01:00">01:00</option>
                    <option value="01:30">01:30</option>
                    <option value="02:00">02:00</option>
                    <option value="02:30">02:30</option>
                    <option value="03:00">03:00</option>
                    <option value="03:30">03:30</option>
                    <option value="04:00">04:00</option>
                    <option value="04:30">04:30</option>
                    <option value="05:00">05:00</option>
                    <option value="05:30">05:30</option>
                    <option value="06:00">06:00</option>
                    <option value="06:30">06:30</option>
                    <option value="07:00">07:00</option>
                    <option value="07:30">07:30</option>
                    <option value="08:00">08:00</option>
                    <option value="08:30">08:30</option>
                    <option value="09:00">09:00</option>
                    <option value="09:30">09:30</option>
                    <option value="10:00">10:00</option>
                    <option value="10:30">10:30</option>
                    <option value="11:00">11:00</option>
                    <option value="11:30">11:30</option>
                    <option value="12:00">12:00</option>
                    <option value="12:30">12:30</option>
                    <option value="13:00">13:00</option>
                    <option value="13:30">13:30</option>
                    <option value="14:00">14:00</option>
                    <option value="14:30">14:30</option>
                    <option value="15:00">15:00</option>
                    <option value="15:30">15:30</option>
                    <option value="16:00">16:00</option>
                    <option value="16:30">16:30</option>
                    <option value="17:00">17:00</option>
                    <option value="17:30">17:30</option>
                    <option value="18:00">18:00</option>
                    <option value="18:30">18:30</option>
                    <option value="19:00">19:00</option>
                    <option value="19:30">19:30</option>
                    <option value="20:00">20:00</option>
                    <option value="20:30">20:30</option>
                    <option value="21:00">21:00</option>
                    <option value="21:30">21:30</option>
                    <option value="22:00">22:00</option>
                    <option value="22:30">22:30</option>
                    <option value="23:00">23:00</option>
                    <option value="23:30">23:30</option>
                  </select>
            </div>
          </div>
         <div className="form-register">         
         <button className="btn btn-primary form-register-btn" type="submit" onClick={searchCar}>SEARCH</button>
        </div> 

            </div>
        </div>
        
  )
}

export default SearchCarBox
